import React, {Component} from 'react';
import {Link, Route, BrowserRouter, HashRouter} from "react-router-dom";
import Login from './Login'
import './menubar_css.css'
import { Navbar, NavItem, NavDropdown, MenuItem, Nav } from 'react-bootstrap';
class Menubar extends Component{
    render(){
      return(
        <>

        <div className="Wrapper">
        <a className="name" href="#"><h2>동아리 모두 모아</h2></a>
        <div className="login">
         <Login></Login>
        </div>
        </div>
        <HashRouter>
        <Nav variant="pills" defaultActiveKey="/home">
  <Nav.Item>
    <Nav.Link href="/home">Active</Nav.Link>
  </Nav.Item>
  <Nav.Item>
    <Nav.Link eventKey="/Search">동아리 보기</Nav.Link>
  </Nav.Item>
  <Nav.Item>
    <Nav.Link eventKey="/Register">동아리 신청</Nav.Link>
  </Nav.Item>
  <Nav.Item>
    <Nav.Link eventKey="/Mypage">마이페이지</Nav.Link>
  </Nav.Item>
</Nav>
      </HashRouter>
      </>
      );
      }
    }

export default Menubar;
